import React, { useContext, useState, useEffect } from 'react';
import { TokenContext } from '../context/TokenContext';
import { Container, Typography, Grid, Button, Paper, Box, Fade } from '@mui/material';
import { useTheme } from '@mui/material/styles';
import Layout from '../components/Layout';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const theme = useTheme();
  const navigate = useNavigate();
  const { currentToken, tokens } = useContext(TokenContext);
  const [animate, setAnimate] = useState(false);

  // Get the most recent token from the tokens array
  const recentToken = tokens.length > 0 ? tokens[tokens.length - 1] : null;

  useEffect(() => {
    setAnimate(true);
  }, []);

  const handleSelect = (gender) => {
    navigate('/services', { state: { gender } });
  };

  return (
    <Layout>
      <Fade in={animate} timeout={800}>
        <Container maxWidth="md">
          <Paper elevation={3} sx={{ p: 4, mb: 6, background: 'linear-gradient(145deg, #f8f8f8 0%, #ffffff 100%)' }}>
            <Box sx={{ textAlign: 'center', mb: 4 }}>
              <Typography variant="h3" component="h1" gutterBottom sx={{ 
                fontWeight: 700,
                background: 'linear-gradient(45deg, #33126B 30%, #FF0A91 90%)',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent',
                mb: 2
              }}>
                Welcome to Purple Salon
              </Typography>
              <Typography variant="h6" color="text.secondary" paragraph>
                Experience premium grooming services
              </Typography>
            </Box>

            <Box sx={{ display: 'flex', gap: 3, mb: 4, flexDirection: { xs: 'column', sm: 'row' } }}>
              {currentToken && (
                <Box sx={{ 
                  flex: 1,
                  bgcolor: 'primary.light',
                  color: 'primary.contrastText',
                  p: 3,
                  borderRadius: 4,
                  boxShadow: 3,
                  textAlign: 'center'
                }}>
                  <Typography variant="h6" gutterBottom>Currently Serving</Typography>
                  <Typography variant="h2" sx={{ fontWeight: 'bold', fontSize: { xs: '3rem', sm: '4rem' } }}>
                    #{currentToken}
                  </Typography>
                </Box>
              )}

              {recentToken && (
                <Box sx={{
                  flex: 1,
                  bgcolor: 'secondary.light',
                  color: 'secondary.contrastText',
                  p: 3,
                  borderRadius: 4,
                  boxShadow: 3,
                  textAlign: 'center',
                  border: '2px dashed',
                  borderColor: 'secondary.main'
                }}>
                  <Typography variant="h6" gutterBottom>Your Token</Typography>
                  <Typography variant="h2" sx={{ 
                    fontWeight: 'bold',
                    fontSize: { xs: '3rem', sm: '4rem' },
                    background: 'linear-gradient(45deg, #FF0A91 30%, #FF8E53 90%)',
                    WebkitBackgroundClip: 'text',
                    WebkitTextFillColor: 'transparent'
                  }}>
                    #{recentToken.tokenNumber}
                  </Typography>
                  <Typography variant="body2" sx={{ mt: 1, opacity: 0.9 }}>
                    {recentToken.gender} • {recentToken.service}
                  </Typography>
                </Box>
              )}
            </Box>

            <Box sx={{ textAlign: 'center', mt: 4 }}>
              <Typography variant="h6" gutterBottom>
                Please select your gender to book a service
              </Typography>
              <Box sx={{ display: 'flex', gap: 3, justifyContent: 'center', mt: 3, mb: 2 }}>
                <Button 
                  variant="contained" 
                  size="large" 
                  onClick={() => handleSelect('male')}
                  sx={{ 
                    minWidth: 150,
                    height: 60,
                    fontSize: '1.1rem',
                    '&:hover': {
                      transform: 'translateY(-3px)',
                      boxShadow: '0 4px 20px rgba(0,0,0,0.2)'
                    }
                  }}
                >
                  ♂ Male
                </Button>
                <Button 
                  variant="contained" 
                  size="large" 
                  color="secondary" 
                  onClick={() => handleSelect('female')}
                  sx={{ 
                    minWidth: 150,
                    height: 60,
                    fontSize: '1.1rem',
                    '&:hover': {
                      transform: 'translateY(-3px)',
                      boxShadow: '0 4px 20px rgba(0,0,0,0.2)'
                    }
                  }}
                >
                  ♀ Female
                </Button>
              </Box>
            </Box>
          </Paper>
        </Container>
      </Fade>
    </Layout>
  );
};

export default Home;
